#include <iostream>
#include <string>
#include <fstream>

using namespace std;

int main(){
	string input = 			"";

	string first = "";
	string second = "";
	string third = "";
	string fourth = "";
	int counter = 0;
	
	for (size_t i = 0; i < 1024; ++i){
		if (counter % 32 == 0)
			counter = 0;
		
		if (counter < 16){
			first += input[i];
			//if (counter == 15)
			//	first += '\n';
		}
		else{
			second += input[i];
			//if (counter == 31)
			//	second += '\n';
		}
		
		++counter;
	}
	
	counter = 0;
	for (size_t i = 1024; i < 2048; ++i){
		if (counter % 32 == 0)
			counter = 0;
		
		if (counter < 16){
			third += input[i];
			//if (counter == 15)
			//	third += '\n';
		}
		else{
			fourth += input[i];
			//if (counter == 31)
			//	fourth += '\n';
		}
		++counter;
	}

	cout << first << second << third << fourth;
	//cout << second << endl << endl;
	//cout << third << endl << endl;
	//cout << fourth << endl << endl;

	return 0;
}
